import React from "react";
import Character from "../Components/Character"; // Assuming you already have a Character component

const styles = {
  container: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    height: "100vh",
    backgroundColor: "#f0f0f0",
  },
  characterContainer: {
    flex: 1,
    display: "flex",
    justifyContent: "center",
  },
  middleContainer: {
    flex: 1,
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    gap: "16px",
  },
  timer: {
    fontSize: "24px",
    fontWeight: "bold",
    color: "#333",
  },
  subtitle: {
    fontSize: "16px",
    fontWeight: "400",
    color: "#666",
  },
  mainTitle: {
    fontSize: "32px",
    fontWeight: "bold",
    color: "#fff",
    textAlign: "center",
    padding: "16px",
    backgroundImage: "url('/path/to/background-image.jpg')", // Replace with your image path
    backgroundSize: "cover",
    backgroundPosition: "center",
    borderRadius: "8px",
    width: "300px",
  },
  vsText: {
    fontSize: "48px",
    fontWeight: "bold",
    color: "#FF337C",
  },
};

const HeadToHead = () => {
  return (
    <div style={styles.container}>
      {/* Left Character */}
      <div style={styles.characterContainer}>
        <Character
          image="/path/to/character1.png" // Replace with actual image paths
          traits={[
            { type: "Virtue", text: "Brave" },
            { type: "Vice", text: "Greedy" },
            { type: "Trade", text: "Blacksmith" },
            { type: "Tidbit", text: "Loves cats" },
          ]}
        />
      </div>

      {/* Middle Section */}
      <div style={styles.middleContainer}>
        <div style={styles.timer}>00:30</div>
        <div style={styles.subtitle}>Prepare for the Ultimate Battle</div>
        <div style={styles.mainTitle}>EPIC SHOWDOWN</div>
        <div style={styles.subtitle}>Who Will Be Victorious?</div>
        <div style={styles.vsText}>VS</div>
      </div>

      {/* Right Character */}
      <div style={styles.characterContainer}>
        <Character
          image="/path/to/character2.png" // Replace with actual image paths
          traits={[
            { type: "Virtue", text: "Smart" },
            { type: "Vice", text: "Impulsive" },
            { type: "Trade", text: "Engineer" },
            { type: "Tidbit", text: "Loves dogs" },
          ]}
        />
      </div>
    </div>
  );
};

export default HeadToHead;
